import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

import * as THREE from "three";
import { OrbitControls } from "three/examples/jsm/controls/OrbitControls";
import {
  Canvas,
  extend,
  useFrame,
  useLoader,
  useThree,
  useUpdate,
} from "react-three-fiber";
import HistoryItem from "./HistoryItem";

function App() {
  const [canvasProjects, setCanvasProjects] = useState([]);
  const [hoveredProject, setHoveredProject] = useState("na");
  const [lastCanvasProjectAdded, setLastCanvasProjectAdded] = useState();
  const [menuHidden, setMenuHidden] = useState(false);

  const [projectData, setProjectData] = useState(
    require("./static/trudy_history_embedded.csv")
  );

  return (
    <div className="bg-red-100">
      <Canvas>
        <OrbitControls />
        <ambientLight intensity={0.5} />
        <spotLight position={[100, 150, 100]} angle={0.3} />
        {/* <Physics> */}
        {/* <Box /> */}
        {projectData.map((project) => {
          return (
            <HistoryItem
              canvasProjects={canvasProjects}
              setCanvasProjects={setCanvasProjects}
              project={project}
              hoveredProject={hoveredProject}
              setHoveredProject={setHoveredProject}
              isSynth={false}
            />
          );
        })}

        {/* </Physics> */}
      </Canvas>
    </div>
  );
}

export default App;
